import "./sidebar.css";
import logo from './assets/logo.png'

export default function SideBar() {
  return (
    <div className="side">
      <div className="content">
        <span>
          <img className="logo" src={logo} alt="" />
        </span>
        <span>
          <p>eLibrary</p>
        </span>
      </div>
    </div>
  );
}
